import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import About from "./Views/About";
import Closet from "./Views/Closet";
import Home from "./Views/Home";
import LogIn from "./Views/LogIn";
import SignUp from "./Views/SignUp";
import Outfit from "./Views/Outfit";
import Nav from "./Components/Nav";
// import Footer from "./Components/Footer";
import NoMatch from "./Views/NoMatch";
import ClothingDetail from "./Views/ClothingDetail";
import { getSession, logOut } from "./utils/Session";
import "./normalize.css";
import "./App.css";

class App extends Component {
  state = {
    session: ""
  };

  componentDidMount() {
    let obj = getSession();
    if (obj) {
      console.log(obj.id);
      this.setState({ session: obj.id });
    }
  }
  render() {
    return (
      <Router>
        <div>
          <Nav />
          <Switch>
            {/* <Route exact path="/" component={LogIn} /> */}
            <Route path="/" component={this.state.session ? Home : LogIn} />
            <Route
              exact
              path="/LogIn"
              component={this.state.session ? LogIn : LogIn}
            />
            <Route
              exact
              path="/About"
              component={this.state.session ? About : About}
            />
            <Route
              exact
              path="/Home"
              component={this.state.session ? Home : LogIn}
            />
            <Route
              exact
              path="/SignUp"
              component={this.state.session ? SignUp : SignUp}
            />
            <Route
              exact
              path="/Closet"
              component={this.state.session ? Closet : LogIn}
            />
            <Route
              exact
              path="/ClothingDetail"
              component={this.state.session ? ClothingDetail : LogIn}
            />
            <Route
              exact
              path="/Outfit"
              component={this.state.session ? Outfit : LogIn}
            />
            <Route
              path="/Outfit/:clothingType/:id"
              component={this.state.session ? Outfit : LogIn}
            />
            <Route
              path="/ClothingDetail/:clothingType"
              component={this.state.session ? ClothingDetail : LogIn}
            />
            <Route
              path="/Closet/:id"
              component={this.state.session ? Closet : LogIn}
            />

            <Route component={NoMatch} />
          </Switch>
          {/* <Footer /> */}
        </div>
      </Router>
    );
  }
}

export default App;
